import React, { Component } from 'react';

export class MyData extends Component {

    constructor(props) {
        super(props);
        this.state ={
            name: "Heiko Kuschel"
        }
    }


    render() {

      return (
        <div >
            <ul>
                <li><button value={this.state.name} type="button"  className="btn btn-success"></button></li>
                <li>Moorweg 1b</li>
                <li>85296 Rohrbach(Ilm)</li>
                <li>Germany</li>
                <li>Haus: 08442 / 959867</li>
                <li>Handy: 015202900968</li>
            </ul>
        </div>
      );
    }
  }
  export default MyData;
